     &k_sym+h1b-1),int_mb(k_sym+h10b-1)))) .eq. irrep_t) THEN
      CALL TCE_RESTRICTED_4(p5b,p9b,h1b,h10b,p5b_1,p9b_1,h1b_1,h10b_1)
      CALL TCE_RESTRICTED_4(h13b,h10b,h2b,p9b,h13b_2,h10b_2,h2b_2,p9b_2)
      dim_common = int_mb(k_range+p9b-1) * int_mb(k_range+h10b-1)
