      DO p13b = noab+1,noab+nvab
      IF (next .eq. count) THEN
      IF ((.not.restricted).or.(int_mb(k_spin+h12b-1)+int_mb(k_spin+p13b
     &-1).ne.4)) THEN
      IF (int_mb(k_spin+h12b-1) .eq. int_mb(k_spin+p13b-1)) THEN
      IF (ieor(int_mb(k_sym+h12b-1),int_mb(k_sym+p13b-1)) .eq. ieor(irre
     &p_v,irrep_t)) THEN
      dimc = int_mb(k_range+h12b-1) * int_mb(k_range+p13b-1)
      IF (.not.MA_PUSH_GET(mt_dbl,two*dimc,'noname',l_c_sort,k_c_sort)) 
     &CALL ERRQUIT('ipeomccsdtq_x4_3_2_2',0,MA_ERR)
      CALL DFILL(two*dimc,0.0d0,dbl_mb(k_c_sort),1)
      DO p10b = noab+1,noab+nvab
      DO h11b = 1,noab
      IF (int_mb(k_spin+p10b-1) .eq. int_mb(k_spin+h11b-1)) THEN
      IF (ieor(int_mb(k_sym+p10b-1),int_mb(k_sym+h11b-1)) .eq. irrep_t) 
     &THEN
      CALL TCE_RESTRICTED_2(p10b,h11b,p10b_1,h11b_1)
      CALL TCE_RESTRICTED_4(h12b,h11b,p13b,p10b,h12b_2,h11b_2,p13b_2,p10
     &b_2)
      dim_common = int_mb(k_range+p10b-1) * int_mb(k_range+h11b-1)
