      IF (.not.MA_POP_STACK(l_a)) CALL ERRQUIT('ipeomccsdtq_x4_10_2',3,M
     &A_ERR)
      IF (.not.MA_PUSH_GET(mt_dbl,two*dimb,'noname',l_b_sort,k_b_sort)) 
     &CALL ERRQUIT('ipeomccsdtq_x4_10_2',4,MA_ERR)
      IF (.not.MA_PUSH_GET(mt_dbl,two*dimb,'noname',l_b,k_b)) CALL ERRQU
     &IT('ipeomccsdtq_x4_10_2',5,MA_ERR)
