     & THEN
      IF (int_mb(k_spin+dummy_p8b-1)+int_mb(k_spin+h13b-1) .eq. int_mb(k
     &_spin+h1b-1)+int_mb(k_spin+h2b-1)) THEN
      IF (ieor(int_mb(k_sym+dummy_p8b-1),ieor(int_mb(k_sym+h13b-1),ieor(
     &int_mb(k_sym+h1b-1),int_mb(k_sym+h2b-1)))) .eq. ieor(irrep_v,irrep
     &_x)) THEN
