     & - 1 + noab * (h10b_1 - 1 + noab * (p11b_1 - noab - 1))))
      CALL TCE_SORT_3(dbl_mb(k_a),dbl_mb(k_a_sort),int_mb(k_range+p11b-1
     &),int_mb(k_range+h10b-1),int_mb(k_range+h1b-1),3,2,1,-1.0d0,.false
     &.)
